import React, { useState, useEffect } from 'react';
import { LeaderboardEntry } from '../../types';

interface LeaderboardProps {}

const Leaderboard: React.FC<LeaderboardProps> = () => {
  const [leaderboard, setLeaderboard] = useState<LeaderboardEntry[]>([]);
  const [loading, setLoading] = useState(true);
  const [filter, setFilter] = useState<'all' | 'weekly' | 'monthly'>('all');

  useEffect(() => {
    fetchLeaderboard();
  }, [filter]);

  const fetchLeaderboard = async () => {
    setLoading(true);
    try {
      const response = await fetch(`http://localhost:8080/api/leaderboard?period=${filter}`);
      const data = await response.json();

      if (data.success) {
        setLeaderboard(data.data || []);
      }
    } catch (error) {
      console.error('Error fetching leaderboard:', error);
    } finally {
      setLoading(false);
    }
  };

  const getRankIcon = (position: number) => {
    switch (position) {
      case 1: return 'ðŸ¥‡';
      case 2: return 'ðŸ¥ˆ';
      case 3: return 'ðŸ¥‰';
      default: return `#${position}`;
    }
  };

  const getRankFromElo = (elo: number): string => {
    if (elo >= 2000) return 'radiant';
    if (elo >= 1800) return 'immortal';
    if (elo >= 1600) return 'diamond';
    if (elo >= 1400) return 'platinum';
    if (elo >= 1200) return 'gold';
    if (elo >= 1000) return 'silver';
    if (elo >= 800) return 'bronze';
    return 'iron';
  };

  const getRankColor = (elo: number): string => {
    const rank = getRankFromElo(elo);
    const colors = {
      radiant: 'from-yellow-400 to-orange-500',
      immortal: 'from-red-500 to-pink-500',
      diamond: 'from-blue-400 to-purple-500',
      platinum: 'from-cyan-400 to-blue-500',
      gold: 'from-yellow-400 to-yellow-600',
      silver: 'from-gray-300 to-gray-500',
      bronze: 'from-orange-600 to-orange-800',
      iron: 'from-gray-600 to-gray-800'
    };
    return colors[rank as keyof typeof colors] || colors.iron;
  };

  if (loading) {
    return (
      <div className="max-w-4xl mx-auto">
        <div className="text-center py-12">
          <div className="spinner mx-auto mb-4"></div>
          <p className="text-valorant-gray-300">Loading leaderboard...</p>
        </div>
      </div>
    );
  }

  return (
    <div className="max-w-4xl mx-auto">
      {/* Header */}
      <div className="text-center mb-8">
        <h1 className="text-4xl font-valorant text-white mb-4 text-glow">
          LEADERBOARD
        </h1>
        <p className="text-valorant-gray-300 text-lg">
          Top players ranked by ELO rating
        </p>
      </div>

      {/* Filter Tabs */}
      <div className="flex justify-center mb-8">
        <div className="bg-valorant-gray-800 p-1 rounded-lg inline-flex">
          {(['all', 'weekly', 'monthly'] as const).map((period) => (
            <button
              key={period}
              onClick={() => setFilter(period)}
              className={`
                px-6 py-2 rounded-md transition-all duration-200 font-medium capitalize
                ${filter === period 
                  ? 'bg-valorant-red text-white' 
                  : 'text-valorant-gray-300 hover:text-white hover:bg-valorant-gray-700'
                }
              `}
            >
              {period === 'all' ? 'All Time' : period}
            </button>
          ))}
        </div>
      </div>

      {/* Leaderboard */}
      <div className="bg-valorant-dark-900 rounded-xl border border-valorant-gray-700 overflow-hidden">
        {/* Header Row */}
        <div className="bg-valorant-gray-800 px-6 py-4">
          <div className="grid grid-cols-5 gap-4 text-sm font-medium text-valorant-gray-300">
            <div>Rank</div>
            <div>Player</div>
            <div>ELO Rating</div>
            <div>Wins/Losses</div>
            <div>Win Rate</div>
          </div>
        </div>

        {/* Player Rows */}
        <div className="divide-y divide-valorant-gray-700">
          {leaderboard.length === 0 ? (
            <div className="text-center py-12">
              <p className="text-valorant-gray-400">No leaderboard data available</p>
            </div>
          ) : (
            leaderboard.map((entry, index) => {
              const position = index + 1;
              const winRate = entry.wins && entry.losses 
                ? Math.round((entry.wins / (entry.wins + entry.losses)) * 100)
                : 0;

              return (
                <div 
                  key={entry.userId}
                  className={`
                    px-6 py-4 hover:bg-valorant-gray-800 transition-colors duration-200
                    ${position <= 3 ? 'bg-gradient-to-r from-valorant-gray-800 to-transparent' : ''}
                  `}
                >
                  <div className="grid grid-cols-5 gap-4 items-center">
                    {/* Rank */}
                    <div className="flex items-center">
                      <span className="text-2xl mr-3">
                        {getRankIcon(position)}
                      </span>
                      <span className="text-white font-bold">
                        {position <= 3 ? '' : `#${position}`}
                      </span>
                    </div>

                    {/* Player */}
                    <div className="flex items-center">
                      <div className={`
                        w-10 h-10 rounded-full flex items-center justify-center text-white font-bold mr-3
                        bg-gradient-to-r ${getRankColor(entry.elo)}
                      `}>
                        {entry.username.charAt(0).toUpperCase()}
                      </div>
                      <div>
                        <div className="text-white font-medium">
                          {entry.username}
                        </div>
                        <div className={`elo-badge elo-${getRankFromElo(entry.elo)}`}>
                          {getRankFromElo(entry.elo).toUpperCase()}
                        </div>
                      </div>
                    </div>

                    {/* ELO */}
                    <div>
                      <div className="text-white font-bold text-xl">
                        {entry.elo}
                      </div>
                      <div className="text-valorant-gray-400 text-sm">
                        ELO Points
                      </div>
                    </div>

                    {/* W/L */}
                    <div>
                      <div className="text-white">
                        <span className="text-green-400 font-medium">
                          {entry.wins || 0}W
                        </span>
                        <span className="text-valorant-gray-400 mx-1">/</span>
                        <span className="text-red-400 font-medium">
                          {entry.losses || 0}L
                        </span>
                      </div>
                      <div className="text-valorant-gray-400 text-sm">
                        {(entry.wins || 0) + (entry.losses || 0)} total
                      </div>
                    </div>

                    {/* Win Rate */}
                    <div>
                      <div className="text-white font-bold">
                        {winRate}%
                      </div>
                      <div className="w-full bg-valorant-gray-700 rounded-full h-2 mt-1">
                        <div 
                          className="bg-gradient-to-r from-green-500 to-green-400 h-2 rounded-full transition-all duration-300"
                          style={{ width: `${winRate}%` }}
                        />
                      </div>
                    </div>
                  </div>
                </div>
              );
            })
          )}
        </div>
      </div>

      {/* Stats Summary */}
      <div className="mt-8 grid md:grid-cols-3 gap-6">
        <div className="card text-center">
          <h3 className="text-lg font-semibold text-white mb-2">Total Players</h3>
          <div className="text-3xl font-bold text-valorant-red">
            {leaderboard.length}
          </div>
        </div>

        <div className="card text-center">
          <h3 className="text-lg font-semibold text-white mb-2">Average ELO</h3>
          <div className="text-3xl font-bold text-valorant-red">
            {leaderboard.length > 0 
              ? Math.round(leaderboard.reduce((sum, entry) => sum + entry.elo, 0) / leaderboard.length)
              : 0
            }
          </div>
        </div>

        <div className="card text-center">
          <h3 className="text-lg font-semibold text-white mb-2">Top Player</h3>
          <div className="text-xl font-bold text-white">
            {leaderboard.length > 0 ? leaderboard[0].username : 'N/A'}
          </div>
          <div className="text-valorant-gray-400">
            {leaderboard.length > 0 ? `${leaderboard[0].elo} ELO` : ''}
          </div>
        </div>
      </div>
    </div>
  );
};

export default Leaderboard;
